import ResponsiveDrawer from "../Components/Sidebar";
import Header from "../Components/Header";
import { Route, Routes, BrowserRouter } from "react-router-dom";

const PaymentPage = () => {
  const getRoutes = () => {
    <BrowserRouter>
      <Routes>
        {Routes.map((route) => (
          <Route
            key={route.id}
            exact
            path={route.path}
            element={route.element}
          />
        ))}
      </Routes>
    </BrowserRouter>;
  };

  return (
    <div>
      <div>
        <Header />
      </div>
      <div>
        <ResponsiveDrawer />
      </div>
      <div>{getRoutes}</div>
    </div>
  );
};

export default PaymentPage;
